ess/?p=3', '0', 'post', '', '0' ); ";i:134;s:329:"INSERT INTO wp_posts VALUES( '4', '1', '2015-05-15 22:23:10', '2015-05-15 22:23:10', '', 'citadelle', '', 'inherit', 'open', 'open', '', 'citadelle', '', '', '2015-05-15 22:23:10', '2015-05-15 22:23:10', '', '0', 'http://localhost:8888/wordpress/wp-content/uploads/2015/05/citadelle.jpg', '0', 'attachment', 'image/jpeg', '0' ); ";i:135;s:352:"INSERT INTO wp_posts VALUES( '5', '1', '2015-05-16 14:03:06', '2015-05-16 14:03:06', '', 'humanayad_233x631', '', 'inherit', 'open', 'open', '', 'humanayad_233x631', '', '', '2015-05-16 14:03:06', '2015-05-16 14:03:06', '', '0', 'http://localhost:8888/wordpress/wp-content/uploads/2015/05/humanayad_233x631.png', '0', 'attachment', 'image/png', '0' ); ";i:136;s:43:"DROP TABLE IF EXISTS wp_term_relationships;";i:137;s:364:"CREATE TABLE `wp_term_relationships` (
